(351,351,1,'About','about','about','{\"d9a8969c-8032-4c8e-a8ab-f64b7f12845e\":\"<p>When Dave Rudolph first picked up a guitar at just 3 years old, few could\'ve predicted the journey it would lead him on. The love and pursuit of music has taken him across the country and made him lifelong fans and friends alike! </p>\\n<p>A veteran performer from Akron, Ohio, he has performed over 800 live shows with a wide variety of bands, both live and in the studio. He has opened for many major acts, such as Jake Owen, Chris Janson, Tracy Byrd, Tyler Farr, Saving Abel, Josh Thompson, and Craig Campbell. </p>\\n<p>He has performed at venues and events ranging from the NFL Hall of Fame Induction Ceremony, WGAR Country Jam, CMA Fest, Piqua Bike Fest, and Hamler Country Fest, to the Thirsty Cowboy, the Little Red Rooster, the Dusty Armadillo, and the world famous Jaegermeister Stage! Tours have laid rubber from Cleveland to Nashville, Oklahoma City to Seattle, Bemidji to Woodruff, and many places between. </p>\\n<p>While he currently resides in Nashville, be sure to catch him on tour as he spreads his music around the nation! </p>\"}',1,'2020-12-10 18:53:33','2020-12-10 18:53:33','ddcdfc17-e15e-4351-a313-5f731531e159'),
