(719,719,1,'About','about','about','{\"d9a8969c-8032-4c8e-a8ab-f64b7f12845e\":\"<h4>When Dave Rudolph first picked up a guitar at just 3 years old, few could\'ve predicted the journey it would lead him on. The love and pursuit of music has taken him across the country and made him lifelong fans and friends alike! </h4>\\n<h4><br /></h4>\\n<h4>A veteran performer from Akron, Ohio, he has performed over 800 live shows with a wide variety of bands, both live and in the studio. He has opened for major acts, such as Jake Owen, Chris Janson, Tracy Byrd, Tyler Farr, Saving Abel, Josh Thompson, and Craig Campbell. </h4>\\n<h4><br /></h4>\\n<h4>He has performed at events ranging from the NFL Hall of Fame Induction Ceremony, WGAR Country Jam, CMA Fest, Piqua Bike Fest, and Hamler Country Fest, to the shows at Thirsty Cowboy, the Little Red Rooster, the Dusty Armadillo, and the world famous traveling Jaegermeister Stage! Tours have laid rubber from Cleveland to Nashville, Oklahoma City to Seattle, Bemidji to Woodruff, and many places between. </h4>\\n<h4><br /></h4>\\n<h4>While he currently resides in Nashville, be sure to catch him on tour as he spreads his brand of music around the nation!</h4>\\n<h4><br /></h4>\\n<h4>Currently available for gigs as a frontman, sideman (vocal harmonies/lead guitar), co-writing, session work, and guitar lessons - send me a message through the contact page!</h4>\\n<figure><img class=\\\"img-fluid\\\" src=\\\"{asset:621:url||/uploads/DSC_9613.jpg}\\\" alt=\\\"Dave Rudolph Fender Tele Telecaster Black Leather Jacket Ripped Jeans Rustic Brooding Intense Serious Musician Promo Picture Photo Guitar Sexy Man Guitarist Singer American Country Rock Outlaw\\\" /><figcaption>Dave Rudolph with his Telecaster - Photo by Anna Bey Photography</figcaption></figure>\"}',1,'2021-02-17 16:53:04','2021-02-17 16:53:04','3b81aa79-a5e3-45d0-9eca-94eaa1c33c4f'),
